window.bookSummaryJSON = "<p>Here is a special edition 20th anniversary release of the number-one <i>New York Times</i> best-selling novel that reignited the entire Star Wars publishing phenomenon - unabridged for the first time. The biggest event in the history of Star Wars books, <i>Heir to the Empire</i> follows the adventures of Luke Skywalker, Han Solo, and Princess Leia after they led the Rebel Alliance to victory in <i>Star Wars: Episode VI Return of the Jedi</i>. </p> <p>Five years after the Death Star was destroyed and Darth Vader and the Emperor were defeated, the galaxy is struggling to heal the wounds of war, Princess Leia and Han Solo are married and expecting twins, and Luke Skywalker has become the first in a long-awaited line of new Jedi Knights. </p> <p>But thousands of light-years away, the last of the Emperorâ€™s warlords - the brilliant and deadly Grand Admiral Thrawn - has taken command of the shattered Imperial fleet, readied it for war, and pointed it at the fragile heart of the New Republic. For this dark warrior has made two vital discoveries that could destroy everything the courageous men and women of the Rebel Alliance fought so hard to create. </p> <p>The explosive confrontation that results is a towering epic of action, invention, mystery, and spectacle on a galactic scale - in short, a story worthy of the name <i>Star Wars</i>.</p>"; 
